import axios from "./BasicUrl"

export const getCarModels = () => {
    return axios.get(`CarModels`)
}

export const getCar = () => {
    return axios.get(`CarModels`)
}

export const postCarModels = (carModel) => {
    return axios.post(`CarModels`, carModel)
}
